import React from 'react';
import './App.css';
import User from "./User";
import About from "./About";

import {
    BrowserRouter,
    Routes,
    Route,
    Link
} from "react-router-dom";

function App() {
  return (

      <BrowserRouter>
       <div className="App">
      <nav>
            <Link to="/"> Home </Link>
            <Link to="about">About</Link>
      </nav>

      <Routes>
            <Route path="/" element={<App/>}/>
            <Route path="/" element={<About/>}/>
      </Routes>

        <User name = {"Virat"} email = {"kohli@gmail.com"}/>
        <User name = {"Sambit"} email = {"sambitgulu@gmail.com"}/>
    </div>
    </BrowserRouter>
  );
}

export default App;
